import ReactDOM from 'react-dom'
import App from './App'

const persons = [
  {
    name: 'Pekka',
    number: '111'
  },
  {
    name: 'Tiina',
    number: '112'
  },
  {
    name: 'Jalmari',
    number: '111SFG<s'
  }
]

ReactDOM.render(
  <App persons={persons} />,
  document.getElementById('root')
)
